function index() {
    const [urldate, setUrldate] = useState(null)
    useEffect(() => {
        const a = window.location.pathname
        var reg = /(?=\/)/g;
        var utld = null
        a.replace(reg, ($, $1) => {
            utld = a.slice($1 + 1)
        })
        setUrldate(utld)
        console.log(utld);
    }, [])
    return (
        <div>
            sdsdsd
        </div>
    )
}

export default index
